jQuery(document).ready(function(){
	( function ( $ ) {
	    "use strict";

	    //bar chart
		var ctx = document.getElementById( "barChart" );
		//    ctx.height = 200;

		var barDataset = [];
		for(var i=0; i < charts.data.length; i++) {
			barDataset.push({
				label: charts.title[i],
				data: charts.data[i],
				borderColor: charts.color[i],
				borderWidth: "0",
				backgroundColor: charts.color[i]
			});
		}
		var myChart = new Chart( ctx, {
		    type: 'bar',
		    data: {
		        labels: charts.days,
		        datasets: barDataset
		    },
		    options: {
		        scales: {
		            yAxes: [ {
		                ticks: {
		                    beginAtZero: true,
		                    borderDashOffset : 0,
		                    stepSize: 1
		                }
		            } ]
		        },
		    }
		} );


	} )( jQuery );
});